import{userModel}from"user-model";class UserControl{constructor(e){this.userModel=e}toggleUserControlElement(){this.userModel.isUserLoggedIn().then(e=>{e?($(".nav-item-user-control").addClass("hidden"),$(".nav-item-profile").removeClass("hidden"),$(".nav-item-user-logout").removeClass("hidden")):($(".nav-item-user-control").removeClass("hidden"),$(".nav-item-profile").addClass("hidden"),$(".nav-item-user-logout").addClass("hidden"))}).catch(e=>{console.log(e.msg)})}}const userControl=new UserControl(userModel);export{userControl};